import React from 'react';
import { useLocation } from 'react-router-dom';
import {
  Box, Typography, Grid, Paper,
} from '@mui/material';

const ReviewerReport = () => {
  const location = useLocation();
  const formData = location.state;

  if (!formData) {
    return (
      <Box p={4}>
        <Typography variant="h6" color="error">
          No data received. Please fill and submit the form first.
        </Typography>
      </Box>
    );
  }

  return (
    <Box sx={{ p: 4 }}>
      <Typography variant="h4" gutterBottom align="center">
        Application Review Report - BPT 2025
      </Typography>

      {/* Section 1: Advertisement Details */}
      <Paper elevation={2} sx={{ p: 2, mb: 3 }}>
        <Typography variant="h6" gutterBottom>Advertisement Details</Typography>
        <Grid container spacing={2}>
          <Grid item xs={6}><strong>Ad. No:</strong> {formData.adNo}</Grid>
          <Grid item xs={6}><strong>Ad. Date:</strong> {formData.adDate}</Grid>
          <Grid item xs={6}><strong>Application No:</strong> {formData.applicationNo}</Grid>
          <Grid item xs={6}><strong>Course Name:</strong> {formData.courseName}</Grid>
          <Grid item xs={6}><strong>Course Code:</strong> {formData.courseCode}</Grid>
          <Grid item xs={6}><strong>Date of Entry:</strong> {formData.dateOfEntry}</Grid>
          <Grid item xs={6}><strong>Last Date:</strong> {formData.lastDate}</Grid>
          <Grid item xs={6}><strong>Department:</strong> {formData.department}</Grid>
        </Grid>
      </Paper>

      {/* Section 2: Applicant Details */}
      <Paper elevation={2} sx={{ p: 2, mb: 3 }}>
        <Typography variant="h6" gutterBottom>Applicant's Details</Typography>
        <Grid container spacing={2}>
          <Grid item xs={6}><strong>Name:</strong> {formData.name}</Grid>
          <Grid item xs={6}><strong>Father's Name:</strong> {formData.fatherName}</Grid>
          <Grid item xs={6}><strong>DOB:</strong> {formData.dob}</Grid>
          <Grid item xs={6}><strong>Age:</strong> {formData.age}</Grid>
          <Grid item xs={6}><strong>Place of Birth:</strong> {formData.birthPlace}</Grid>
          <Grid item xs={6}><strong>Social Status:</strong> {formData.status}</Grid>
          <Grid item xs={6}><strong>Nationality:</strong> {formData.nationality}</Grid>
          <Grid item xs={6}><strong>Marital Status:</strong> {formData.maritalStatus}</Grid>
          <Grid item xs={6}><strong>Gender:</strong> {formData.gender}</Grid>
          <Grid item xs={6}><strong>Differently Abled:</strong> {formData.differentlyAbled}</Grid>
          <Grid item xs={6}><strong>ID Mark 1:</strong> {formData.idMark1}</Grid>
          <Grid item xs={6}><strong>ID Mark 2:</strong> {formData.idMark2}</Grid>
          <Grid item xs={6}><strong>University Area:</strong> {formData.universityArea}</Grid>
          <Grid item xs={6}><strong>In Service (Govt.):</strong> {formData.inService}</Grid>
          <Grid item xs={6}><strong>Aadhar:</strong> {formData.aadhar}</Grid>
